create table payments
(
    id                                int unsigned auto_increment comment '付款信息ID'
        primary key,
    user_id                           int unsigned    default 0                 not null comment '下单用户ID',
    out_trade_no                      varchar(32)                               not null comment '账单编号（与订单ID所关联订单的编号不同，多个订单可以通过一个账单支付）',
    wechat_out_trade_no               varchar(32)     default ''                not null comment '微信账单编号',
    amount_in_cents                   bigint unsigned                           not null comment '支付金额',
    paid_with_alipay_amount_in_cents  bigint unsigned default 0                 not null comment '使用支付宝支付的金额',
    paid_with_wechat_amount_in_cents  bigint unsigned default 0                 not null comment '使用微信支付的金额',
    paid_with_balance_amount_in_cents bigint unsigned default 0                 not null comment '使用余额支付的金额',
    description                       text                                      not null comment '订单内容描述',
    payment_type                      tinyint                                   not null comment '支付方式，0：微信、1：余额',
    payment_status                    tinyint                                   not null comment '支付状态，0：未支付、1：已支付、2：用户取消、3：超时自动取消',
    expired_at                        datetime                                  not null comment '失效时间，用户需在该时间前完成支付',
    paid_at                           datetime                                  null comment '支付时间',
    created_at                        datetime        default CURRENT_TIMESTAMP not null,
    updated_at                        datetime                                  null,
    deleted_at                        datetime                                  null
)
    collate = utf8mb4_unicode_ci;

create index payments_expired_at_index
    on payments (expired_at);

create index payments_out_trade_no_index
    on payments (out_trade_no);

create index payments_paid_at_index
    on payments (paid_at);

create index payments_payment_status_index
    on payments (payment_status);

create index payments_user_id_index
    on payments (user_id);

create index payments_wechat_out_trade_no_index
    on payments (wechat_out_trade_no);

